import React, { useState } from "react";
import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <div className="nav">
      <ul>
        <li>Home</li>
      </ul>
      <ul>
        <li >Login</li>
        <Link to="/login">Login</Link>
      </ul>
    </div>
  );
};

export default NavBar;
